I got to go climbing with Dory Trimble yesterday - she’s been the executive director of the @honnoldfoundation for the last year. She’s done an amazing job of scaling up the Foundation’s impact while insulating me from much of the hard work (which allows me to climb more :) )
@rockandicemag recently ran a feature article about the genesis of the Honnold Foundation and the work that we’ve supported over the years. It was a real pleasure to talk about a different aspect of my life and what it means to me. Read the full story at the link in bio:
Pic: @shawn_corrigan

The perch below the Boulder Problem - the last place to chalk up before doing the hardest 12 moves of the route. This was probably the most intense position on all of El Cap, not that I remember it that way since I just chalked up and climbed. This was taken by the remote cameras filming @freesolofilm - there weren’t any camera men there because it seemed like too much for all involved.
For those that haven’t see it yet, Free Solo expands to 400 theaters around the country this weekend which is it’s widest reach yet. For those in Europe and the rest of the world: have patience, it’s rolling out over the next few months. And it will eventually show on the @natgeochannel and then be online in some way. Sorry I don’t have more details, I honestly don’t know what the whole plan is. I’ve tried to focus on the climbing and let the rest of the team work on the rest...
